import React from "react";
import { Link } from "react-router-dom";
import { FaDownload } from "react-icons/fa"; // You can install react-icons using npm or yarn

function Resume() {
  return (
    <div
      style={{
        textAlign: "center",
        padding: "20px",
        maxWidth: "800px",
        margin: "auto",
      }}
    >
      <h1 style={{ color: "#839366" }}>My Resume</h1>
      <p style={{ fontSize: "18px", color: "#f8f9f6" }}>
        Download my resume to learn more about my professional background and
        skills.
      </p>
      <Link
        to="/resume.pdf"
        download
        style={{
          display: "inline-block",
          padding: "10px 20px",
          fontSize: "16px",
          color: "#f8f9f6",
          backgroundColor: "#4c7051",
          textDecoration: "none",
          borderRadius: "5px",
          border: "1px solid #4c7051",
        }}
      >
        <FaDownload style={{ marginRight: "8px" }} />
        Download Resume
      </Link>
    </div>
  );
}

export default Resume;
